import React from 'react';
import BackButton from './BackButton';
import FullScreenButton from './FullScreenButton'
import "./TopButtons.css"

function TopButtons(isHome) {
  console.log(isHome)
  return (
    <div className="topButtons">
      {!isHome.isHome &&
      <BackButton/>}
      <FullScreenButton/>
    </div>
  );
}

export default TopButtons;
